para predi\u00e7\u00f5es de curta dura\u00e7\u00e3o, e, quanto maior for o horizonte de predi\u00e7\u00e3o, maior ser\u00e1 o erro associado. Outro fator importante a ser considerado aqui \u00e9 que todos os modelos apresentados foram obtidos automaticamente. Isto \u00e9, existe um algoritmo que captura os dados do minist\u00e9rio da sa\u00fade e de mobilidade, e realiza as predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"14989","type":"Paragraph"},{"attributes":{"dimension":"height","line_dash":[6],"line_width":0.5,"location":1591833600000.0},"id":"14938","type":"Span"},{"attributes":{"source":{"id":"14696"}},"id":"14700","type":"CDSView"},{"attributes":{"data_source":{"id":"14943"},"glyph":{"id":"14944"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"14945"},"selection_glyph":null,"view":{"id":"14947"}},"id":"14946","type":"GlyphRenderer"},{"attributes":{"label":{"value":"70% do valor Normal"},"renderers":[{"id":"14699"}]},"id":"14725","type":"LegendItem"},{"attributes":{"label":{"value":"60% do valor Normal"},"renderers":[{"id":"14729"}]},"id":"14757","type":"LegendItem"},{"attributes":{},"id":"15010","type":"Selection"},{"attributes":{"data_source":{"id":"14696"},"glyph":{"id":"14697"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"14698"},"selection_glyph":null,"view":{"id":"14700"}},"id":"14699","type":"GlyphRenderer"},{"attributes":{"data":{"x":{"__ndarray__":"AADAAucRd0IAAIBoORJ3QgAAQM6LEndCAAAANN4Sd0IAAMCZMBN3QgAAgP+CE3dCAABAZdUTd0IAAADLJxR3QgAAwDB6FHdCAACAlswUd0IAAED8HhV3QgAAAGJxFXdCAADAx8MVd0IAAIAtFhZ3QgAAQJNoFndCAAAA+boWd0IAAMBeDRd3QgAAgMRfF3dCAABAKrIXd0IAAACQBBh3Qg
